import{_ as e,o as t,c as o,O as r}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 20-88.64:5 Contest by obligor.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/20-88.64:5.md","filePath":"vacode/20-88.64:5.md"}'),i={name:"vacode/20-88.64:5.md"},a=r('<h1 id="§-20-88-64-5-contest-by-obligor" tabindex="-1">§ 20-88.64:5 Contest by obligor. <a class="header-anchor" href="#§-20-88-64-5-contest-by-obligor" aria-label="Permalink to &quot;§ 20-88.64:5 Contest by obligor.&quot;">​</a></h1><p>A. An obligor may contest the validity or enforcement of an income-withholding order issued in another state and received directly by an employer in the Commonwealth by registering the order in a tribunal of the Commonwealth and filing a contest to that order as provided in this chapter or otherwise contesting the order in the same manner as if the order had been issued by a tribunal of the Commonwealth.</p><p>B. The obligor shall give notice of the contest to (i) a support enforcement agency providing services to the obligee, (ii) each employer that has directly received an income-withholding order relating to the obligor, and (iii) the support enforcement agency designated to receive payments in the income-withholding order.</p><p>1997, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0797" target="_blank" rel="noreferrer">797</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0897" target="_blank" rel="noreferrer">897</a>; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0754" target="_blank" rel="noreferrer">754</a>.</p>',4),n=[a];function l(s,c,h,d,g,p){return t(),o("div",null,n)}const m=e(i,[["render",l]]);export{b as __pageData,m as default};
